import React from 'react';
import "./Style/OurCats.css";

import Breadcrumbs from '@mui/material/Breadcrumbs';
import Link from '@mui/material/Link';

function OurCats(){
	return(
		<div class="Home">
			<Breadcrumbs separator=" ">
  				<Link underline="none">
  				You are here :
  				</Link>
 				 <Link>
  				Our Cats
  				</Link>
 			</Breadcrumbs>
		</div>
		);
}

export default OurCats;
